import React from 'react';

export default class List extends React.Component {
    state = {
        novaTarefa: '',
        tarefas: []
    }
    

    constructor(props) {
        super(props);

        this.tarefas = this.props.tarefas;
    }
    render() {
        return (
            <ul className='tarefa'>
                    {this.tarefas.map(tarefa => (<li key={tarefa}>{tarefa}</li>))}
            </ul>        
        );
    }
}
